import requests

url = "https://us-geo-data2.p.rapidapi.com/zips/radius"
querystring = {"lng": lng, "lat": lat, "radius": radius, "zip": zip}

headers = {
    "X-RapidAPI-Key": "SIGN-UP-FOR-KEY",
    "X-RapidAPI-Host": "us-geo-data2.p.rapidapi.com"
}

response = requests.get(url, headers=headers, params=querystring)

print(response.json())

